column36:
Este aproape imposibil să nu te expui la intoxicații cu metale grele. În primul rând, pentru că sursele de intoxicare sunt peste tot: în pământ, în aer, în apă.
Dintre cel mai des întâlnite intoxicații este cea cu mercur.

Cum vă puteți proteja:
❗ consumați pește care nu poate avea mercur: somon, hering, sardine, ansoa, păstrăv sau macrou;
❗ nu folosiți plombe dentare de amalgam, care conțin aproape 40-50% mercur;
❗ evitați unele vaccinuri;
❗ nu folosiți vopsele vechi;
❗ nu stați în preajma centralelor pe cărbune.

Dacă deja credeți că aveți o intoxicație cu mercur, cea mai eficientă soluție este chelarea de metale grele. Motodele naturiste pot avea efect, pe termen lung, dar nu pot elimina repede și bine mercurul.

#intoxicatiemercur #intoxicatiemetalegrele #chelaremetalegrele #imunomedica #detoxifiere
